import React from 'react'
import Layout from '../Layout/Layout'
import BusFeatures from '../Features/BusFeatures'

const Bus = () => {
  return (
    <>
    <Layout title={'Bus Page is here.'}>
    <BusFeatures/>
    </Layout>
    </>
  )
}

export default Bus
